import React from 'react'

const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part partName={props.parts[0].name} partExercises={props.parts[0].exercises} />
      <Part partName={props.parts[1].name} partExercises={props.parts[1].exercises} />
      <Part partName={props.parts[2].name} partExercises={props.parts[2].exercises} />
    </div>
  )
}

const Part = (props) => {
  return (
    <p>{props.partName} {props.partExercises}</p>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.parts[0].exercises + props.part[1].exercises + props.part[2].exercises}</p>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]


  return (
    <div>
      <Header course={course}/>
      <Content parts={parts} />
      <Total parts={parts} />
    </div>
  )
}

export default App
